import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <div>
        <input
          type="text"
          placeholder="E-mail"
          data-testid="email-input"
        />

        <input
          type="password"
          placeholder="Senha"
          data-testid="password-input"
        />
      </div>
    );
  }
}

export default Login;
